import Container from "react-bootstrap/Container";
import logo from "./logo.svg";

function App() {
  return (
    <Container>
      <h1>Hello World</h1>
      <img src={logo} alt="osaka design office" className="img-fluid"></img>
      <p>Let's make SPA!</p>
    </Container>
  );
}

export default App;
